import { Box, Stack } from "@chakra-ui/layout";
import Home_bg from "../Background/home_bg.jpg";
export default function Home() {
  return (
    <Stack>
      <Box
        w="100vw"
        bgImg={Home_bg}
        bgRepeat={"no-repeat"}
        bgSize={"100% auto"}
      ></Box>
      <Box bgColor="#ffe067"></Box>
    </Stack>
  );
}
